import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@material-ui/core';

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
  header: {
    fontWeight: 'bold',
  },
  summaryRow: {
    backgroundColor: 'yellow',
    fontWeight: 'bold',
  },
});

const DataTable = ({ data, tabIndex }) => {
  const classes = useStyles();

  if (!data || data.length === 0) {
    return <p>No data to display</p>;
  }

  // Calculate summary data
  const totalSales = data.reduce((acc, item) => acc + (item.attributes?.approximate_30_day_units_sold || 0), 0);
  const totalRevenue = data.reduce((acc, item) => acc + (item.attributes?.approximate_30_day_revenue || 0), 0);
  const averagePrice = (totalRevenue / totalSales).toFixed(2);
  const averageReviews = (data.reduce((acc, item) => acc + (item.attributes?.reviews || 0), 0) / data.length).toFixed(0);

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} stickyHeader aria-label="sticky table">
        <TableHead>
          <TableRow>
            <TableCell className={classes.header}>Image</TableCell>
            <TableCell className={classes.header}>ASIN</TableCell>
            <TableCell className={classes.header}>Title</TableCell>
            <TableCell className={classes.header}>Brand</TableCell>
            <TableCell className={classes.header}>Price</TableCell>
            <TableCell className={classes.header}>Sales</TableCell>
            <TableCell className={classes.header}>% of Total Sales</TableCell>
            <TableCell className={classes.header}>Revenue</TableCell>
            <TableCell className={classes.header}>% of Total Revenue</TableCell>
            <TableCell className={classes.header}>Category</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          <TableRow className={classes.summaryRow}>
            <TableCell></TableCell>
            <TableCell colSpan={2}>Summary</TableCell>
            <TableCell></TableCell>
            <TableCell>${averagePrice}</TableCell>
            <TableCell>{totalSales}</TableCell>
            <TableCell>{((totalSales / totalSales) * 100).toFixed(2)}%</TableCell>
            <TableCell>${totalRevenue.toFixed(2)}</TableCell>
            <TableCell>{((totalRevenue / totalRevenue) * 100).toFixed(2)}%</TableCell>
            <TableCell></TableCell>
          </TableRow>
          {data.map((item, index) => {
            if (!item.attributes || !item.attributes.asin) {
              return null;
            }
            const {
              parent_asin,
              title,
              brand,
              price,
              approximate_30_day_units_sold,
              approximate_30_day_revenue,
              reviews,
              image_url,
              category
            } = item.attributes;

            return (
              <TableRow key={index}>
                <TableCell><img src={image_url} alt={title} width="50" height="50" /></TableCell>
                <TableCell>{parent_asin}</TableCell>
                <TableCell>{title}</TableCell>
                <TableCell>{brand}</TableCell>
                <TableCell>${price.toFixed(2)}</TableCell>
                <TableCell>{approximate_30_day_units_sold}</TableCell>
                <TableCell>{((approximate_30_day_units_sold / totalSales) * 100).toFixed(2)}%</TableCell>
                <TableCell>${approximate_30_day_revenue.toFixed(2)}</TableCell>
                <TableCell>{((approximate_30_day_revenue / totalRevenue) * 100).toFixed(2)}%</TableCell>
                <TableCell>{category}</TableCell>
              </TableRow>
            );
          })}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default DataTable;
